stations = getlist()
stationDots = []
MTAmap.turtle.speed(0)
v=[]
#move throuhgt the stations
for station in stations:
    d = MTAmap.datapoint()
    name = station[0][2].lower()
    #d.setTitle1(name)
    name = name.replace(" st","")
    name = name.replace("w ","west-")
    name = name.replace(" ","")
    name = name.strip()#edit to find stations
    if "-" in name:
        name = name.split('-')
    else:
        name = name.split('/')
    line = [station[3][0].lower()]
    
    line.append(name[0])#just use 1 station name
    #print(line)
    size = int(100*(station[4]/4891.009037503631))
    #d.setTitle2(str(size)) #creat dots
    v.append((d.setTag(line)))
    d.setColor("black")
    if size>40:
        d.setColor("red")
    elif size>30:
        d.setColor("orange")
    elif size>25:
        d.setColor("yellow") 
    elif size>20:
        d.setColor("green")
    elif size>10:
        d.setColor("blue")    
    d.setSize(size)#size
    stationDots.append(d)

MTAmap.setupWindow()
MTAmap.clearWindow()
MTAmap.drawMTAMap()
MTAmap.turtle.speed(0)

    

#dot each spot
for i in stationDots:
    i.draw()



MTAmap.turtle.exitonclick()

